import React, { useState } from 'react';
import axios from 'axios';
import { getValue } from '@testing-library/user-event/dist/utils';

const ImgShow = () => {
  const [data, setData] = useState([]);
   const img = axios.get(`https://api.unsplash.com/search/photos?page=1&query=mango&client_id=ikvYI_xvWMlYfFV5Duf_PHIROnel084AYun5cEY5lUQ`)
   .then((response) => {
    console.log(response);
    setData(response.data.result);
   })
    
  return (
    <>
      <div>
      {
        img.map((value, index) => {
          <img src={value.urls.small} alt="any image"/>
        })
      }
       
      </div>
    </>
  )
}

export default ImgShow
